import React from 'react';
import { Card, CardContent, Typography, Grid } from '@mui/material';
import './Hero.css';

const Hero3 = () => {
  const experiences = [
    {
      company: "Company A",
      role: "Software Engineer",
      description: "Worked on developing scalable web applications and contributed to multiple projects using React and Node.js.",
    },
    {
      company: "Company B",
      role: "Frontend Developer",
      description: "Specialized in creating responsive UI components with React and Material-UI, improving user engagement by 30%.",
    },
    {
      company: "Company C",
      role: "Backend Developer",
      description: "Designed and implemented RESTful APIs with Node.js and Express, enhancing data retrieval efficiency by 40%.",
    },
  ];

  return (
    <section className="hero">
      <h1>Experiences</h1>
      <Grid container spacing={4} justifyContent="center">
        {experiences.map((exp, index) => (
          <Grid item xs={12} sm={6} md={4} key={index}>
            <Card>
              <CardContent>
                <Typography variant="h5" component="div">
                  {exp.company}
                </Typography>
                <Typography variant="subtitle1" color="text.secondary">
                  {exp.role}
                </Typography>
                <Typography variant="body2">
                  {exp.description}
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </section>
  );
};

export default Hero3;
